import base64
import io
from PIL import Image

def save_base64_image(base64_string, output_path):
    """
    base64 형식의 이미지 문자열을 이미지 파일로 저장합니다.
    
    Args:
        base64_string (str): "data:image/png;base64," 로 시작하는 base64 인코딩된 문자열
        output_path (str): 저장할 이미지 파일 경로
    """
    # 접두사 제거 (만약 있다면)
    if "," in base64_string:
        base64_data = base64_string.split(",")[1]
    else:
        base64_data = base64_string
    
    # base64 디코딩
    image_data = base64.b64decode(base64_data)
    
    # 이미지로 변환 및 저장
    image = Image.open(io.BytesIO(image_data))
    image.save(output_path)
    print(f"이미지가 {output_path}에 저장되었습니다.")

# 사용 예시
# API 응답에서 받은 base64 이미지 문자열
base64_image = "data:image/png;base64,"

# 이미지 저장
save_base64_image(base64_image, "generated_image.png")
